#include <iostream>
#include <vector>

int main() {
	int sievesize;
	std::cin >> sievesize;
	std::vector<int> sieve(sievesize, 1);
	for (int i = 2; (i * i) < sievesize; i++) {
		if (sieve[i]) {
			for (int j = i + i; j < sievesize; j += i) {
				sieve[j] = 0;
			}
		}
	}
	int kazu = 0;
	for (int i = 0; i < int(sieve.size()); i++) {
		if (sieve.at(i) == 0) {
			kazu++;
		}
	}
	std::cout << kazu << std::endl;
}
